import React, {Component} from 'react';
import ParticleWrapper from './ParticleWrapper';
import {Grid, Cell} from 'react-mdl';

class Contact extends Component {
    render() {
        return (
            <div>
                <Grid>
                    <Cell col = {12}>
                        <h1>Middle</h1>
                    </Cell>
                </Grid>
            </div>
        );
    }
}

export default Contact;
